import { v4 as uuidv4 } from "uuid";

export const Util = () => {

    return [
        {
            name: "Kinsfolk",
            artist: "Aarigod",
            cover: "https://chillhop.com/wp-content/uploads/2021/02/7f102bdde417f6ead9a120b2b931449e5c12b4da-1024x1024.jpg",
            id: uuidv4(),
            active: false,
            audio: "https://mp3.chillhop.com/serve.php/?mp3=12997",
        },

        {
            name: "Beyond Clouds",
            artist: "Saib",
            cover: "https://chillhop.com/wp-content/uploads/2021/02/08cbb0848f669e1bd8b5a5152c4b7d20edf1b499-1024x1024.jpg",
            id: uuidv4(),
            active: false,
            audio: "https://mp3.chillhop.com/serve.php/?mp3=9297",
        },

        {
            name: "Colors Fade",
            artist: "Sleepy Fish",
            cover: "https://chillhop.com/wp-content/uploads/2020/09/686808356b2bbc6a368e372ea604150bc346c788-1024x1024.jpg",
            id: uuidv4(),
            active: false,
            audio: "https://mp3.chillhop.com/serve.php/?mp3=45269",
        }
    ]
}
